import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div style={{display: 'flex', flexdirection: 'column'}}>
    <h1 style={{margin: 20, alignSelf: 'center'}}>Fibonacci Numbers Generator</h1>
    <h2>Enter a positive integer(n) for generating first n fibonacci numbers</h2>
    </div>
  );
}

export default App;
